function _get_token_decimals(address token) public view returns (uint256) {

    bytes memory data = abi.encodeWithSignature("decimals()");

    if(token.code.length == 0){
            return 0;
    }

    (bool success, bytes memory result) = token.staticcall(data);

    if (!success) {
        return 0;
    }

    // Decode the result  
    uint8 decimals = abi.decode(result, (uint8));

    return decimals;
}



function _get_interest_rate_formatted(uint16 interestRate) public pure returns (string memory) {
    return string(abi.encodePacked( (interestRate / 100).toString(), " %"));
}

function _get_duration_formatted(uint32 sec) public pure returns (string memory) {
        uint32 _months = sec / 4 weeks;
        uint32 _weeks = sec / 1 weeks;
        uint32 _days = sec / 1 days;
        uint32 _hours = sec / 1 hours;
        uint32 _minutes = sec / 1 minutes;

        if (_months >= 2) {
            return string(abi.encodePacked(_months.toString(), " months"));
        } else if (_weeks >= 2) {
            return string(abi.encodePacked(_weeks.toString(), " weeks"));
        } else if (_days >= 2) {
            return string(abi.encodePacked(_days.toString(), " days"));
        } else if (_hours >= 2) {
            return string(abi.encodePacked(_hours.toString(), " hours"));
        } else {
            return string(abi.encodePacked(_minutes.toString(), " minutes"));
        }
    }


 function _get_token_symbol(address nftContract, string memory _fallback) public view returns (string memory) {
        bytes memory data = abi.encodeWithSignature("symbol()");

        if(nftContract.code.length == 0){
            return _fallback;
        }

        (bool success, bytes memory result) = nftContract.staticcall(data);

        if (!success) {
            return _fallback ;
        }

        // Decode the result from bytes to string
        string memory symbol = abi.decode(result, (string));

        return symbol;

} 


function _get_collateral_label(Collateral memory collateral) public view returns (string memory) {

    if(collateral._collateralAddress == address(0)){
        return "None";
    }

    if(collateral._collateralType == CollateralType.ERC20){
        string memory collateralAmountFormatted = _get_token_amount_formatted( 
                collateral._amount,
                _get_token_decimals(collateral._collateralAddress)

            );

        string memory collateralTokenSymbol = _get_token_symbol(collateral._collateralAddress,"?");  

        return string(abi.encodePacked(collateralAmountFormatted," ",collateralTokenSymbol));
    }

    if(collateral._collateralType == CollateralType.ERC721){ 

        return _get_token_symbol(collateral._collateralAddress, "ERC721");
    }

    if(collateral._collateralType == CollateralType.ERC1155){

        return _get_token_symbol(collateral._collateralAddress, "ERC1155");
    }



}

